import Sidebar from "./components/Sidebar";
import Home from "./pages/Home";

function App() {
  return (
    <div className="main">
      <Sidebar />
      <div className="right_content">
        <img src="assets/images/top_line.svg" className="top_line" />
        <img src="assets/images/net.svg" className="net" />
        <Home />
      </div>
    </div>
  );
}

export default App;
